onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 3.5;
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
onClipEvent(enterFrame){
   this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 3.5;
}
